import React from "react";
import styles from "../Input/input.module.scss";
const Input = ({ placeholder, type, error, focus }) => {
  return (
    <input
      type={type}
      placeholder={placeholder}
      onFocus={() => focus()}
      className={error ? styles.input.error : styles.input}
    ></input>
  );
};
export default Input;
